<template>
    <div id="dateContainer">
      <div class="yaoBox">
        <div class="yaoBoxChild">
          <div class="yaogan" @click="dianji" :style="'height:'+height+';'">
            <img src="../assets/img/rocker.png" alt="">
          </div>
          <dl class="gundong">
            <dd class="dd" :style="'background-position-y:'+position1+';'"></dd>
            <dd class="dd" :style="'background-position-y:'+position2+';'"></dd>
            <dd class="dd" :style="'background-position-y:'+position3+';'"></dd>
          </dl>
        </div>
      </div>
    </div>
</template>
<script>
  export default {
    data() {
      return {
        timer1:null,
        timer2:null,
        timer3:null,
        timer4:null,
        height: '64px',
        brr: [3,1,3,1,1,2,1,0,5,2,1,2],
        arr: ['20px','63px','58px','50px','44px','64px'],
        num:0,
        num1:0,
        num2:0,
        num3:0,
        position1: '0px',
        position2: '0px',
        position3: '0px',
        random1:0,
        random2:0,
        random3:0
      }
    },
    methods: {
      dianji(){
        this.timer1=setInterval(() => {
          this.setHeight()
        }, 200);
        this.random1 = Math.floor(Math.random()*10+1)
        this.random2 = Math.floor(Math.random()*10+1)
        this.random3 = Math.floor(Math.random()*10+1)
        console.log(this.random1,this.random2,this.random3)
        this.timer2=setInterval(() => {
          this.setGun()
        }, 100);
        setTimeout(()=>{
          this.timer3=setInterval(() => {
            this.setGun2()
          }, 100);
        },250)
        setTimeout(()=>{
          this.timer4=setInterval(() => {
            this.setGun3()
          }, 100);
        },500)
      },
      setGun () {
        if (this.num1>(32+this.random1)*95.4) {
          // this.position1 = '-2957.4px'
          clearInterval(this.timer2)
          this.num1 = 0
          return false
        }
        this.num1 = this.num1 + 95.4
        this.position1 = '-'+this.num1 + 'px'
      },
      setGun2 () {
        if (this.num2>(32+this.random2)*95.4) {
          clearInterval(this.timer3)
          this.num2 = 0
          // 95.4*31
          // this.position1 = '-2957.4px'
          return false
        }
        this.num2 = this.num2 + 95.4
        this.position2 = '-'+this.num2 + 'px'
      },
      setGun3 () {
        if (this.num3>(32+this.random3)*95.4) {
          // this.position3 = '-2957.4px'
          clearInterval(this.timer4)
          this.num3 = 0
          return false
        }
        this.num3 = this.num3 + 95.4
        this.position3 = '-'+this.num3 + 'px'
      },
      setHeight(){
        if (this.num>this.arr.length) {
          clearInterval(this.timer1)
          this.num = 0
          return false
        }
        this.height = this.arr[this.num]
        this.num = this.num+1
      },
    },
    mounted() {
      
    }
  }
</script>
